import UpdatedComponent from "./widthCounter";

class testcomp extends Component {
  
  render() {
    const {count, incrementCount} = this.props
    return (
      <div>
       <h1 onMouseOver={incrementCount}> Hello {count}</h1>
      </div>
    );
  }
}

export default UpdatedComponent( testcomp);
